import React from "react";

const LoginForm = () => {
  const styles = {
    body: {
      margin: 0,
      padding: 0,
      height: "100%",
      width: "100%",
    },
    background: {
      backgroundImage: "url('LBG.png')", // Replace with your image URL
      backgroundSize: "cover",
      backgroundPosition: "center",
      backgroundAttachment: "fixed",
      height: "100%",
      width: "120%",
      overfl
    },
    formWrapper: {
      display: "flex",
      justifyContent: "center",
      alignItems: "center",
      height: "100vh",
    },
    formContainer: {
      background: "rgba(255, 255, 255, 0.7)",
      backdropFilter: "blur(0px)",
      WebkitBackdropFilter: "blur(0px)",
      borderRadius: "10px",
      padding: "25px",
      boxShadow: "0 4px 6px rgba(0, 0, 0, 0.1)",
      width: "500px",
    },
    input: {
      width: "100%",
      padding: "10px",
      margin: "10px 0",
      border: "1px solid #ccc",
      borderRadius: "10px",
    },
    button: {
      width: "100%",
      padding: "10px",
      margin: "10px 0",
      border: "1px solid #ccc",
      borderRadius: "10px",
      backgroundColor: "#C1B857",
      color: "#363100",
      cursor: "pointer",
      fontWeight: "700",
    },
    buttonHover: {
      backgroundColor: "#948d44",
    },
    forgotPassword: {
      display: "block",
      textAlign: "center",
      fontSize: "16px",
      color: "#363100",
      marginTop: "10px",
      textDecoration: "none",
      fontWeight: "300",
    },
    forgotPasswordHover: {
      textDecoration: "underline",
    },
    socialButtonsContainer: {
      display: "flex",
      justifyContent: "center",
      gap: "30px", // Space between the buttons
      marginTop: "20px",
    },
    socialButtonImg: {
      width: "100%",
      maxWidth: "45px", // Ensure images do not stretch too much
      height: "auto",
      borderRadius: "10px",
      cursor: "pointer",
    },
    socialButtonImgHover: {
      opacity: "0.9",
    },
    signup: {
      justifyContent: "center",
      display: "flex",
      marginTop: "30px",
    },
    signupText: {
      fontSize: "14px",
      fontWeight: "200",
      color: "#363100",
    },
    signupLink: {
      textDecoration: "none",
      fontWeight: "700",
      color: "#363100",
    },
  };

  return (
    <div style={styles.background}>
      <div style={styles.formWrapper}>
        <div style={styles.formContainer}>
          <form>
            <h2 style={{ textAlign: "center", fontSize: "70px", color: "#363100", fontWeight: "800" }}>
              <span>
                <img src="cuisining-wordmark.png" alt="C" style={{ height: "60px", width: "60px", marginBottom: "10px" }} />
              </span>
              UISINING
            </h2>
            <input type="text" placeholder="Username" required style={styles.input} />
            <input type="password" placeholder="Password" required style={styles.input} />
            <button type="submit" style={styles.button}>Login</button>
            <a href="#" className="forgot-password" style={styles.forgotPassword}>Forgot Password?</a>
            <hr />
            <div style={styles.socialButtonsContainer}>
              <a href="#" className="social-button" style={styles.socialButtonImg}>
                <img src="cuisining-wordmark.png" alt="Facebook Login" style={styles.socialButtonImg} />
              </a>
              <a href="#" className="social-button" style={styles.socialButtonImg}>
                <img src="cuisining-wordmark.png" alt="Google Login" style={styles.socialButtonImg} />
              </a>
            </div>
            <div style={styles.signup}>
              <p style={styles.signupText}>
                New to Cuisining? <a href="" style={styles.signupLink}>Sign Up</a>
              </p>
            </div>
          </form>
        </div>
      </div>
    </div>
  );
};

export default LoginForm;
